import React from 'react'
import { StyledHatch } from './HatchStyle';
 const Hatch =({hatchData:{id,nr,text,img,open},handleClick})=>(
 <StyledHatch>
      <div className={open ? "front open" : "front" }>
        <p>{nr}</p>
      </div>
      <div className={open ? "back open" : "back" }>
        <p>{text}</p>
      </div>
      </StyledHatch>
  );
  

export default Hatch;
